    def ClearButtonFunc(self):
        self.label_5.setText("")   

    def AddPlugButtonFunc(self):
        char1 = self.comboBox_7.currentText()
        char2 = self.comboBox_8.currentText()
        
        self.enigma.add_plug2(char1,char2)
        self.label_6.setText(self.enigma.get_plugboard())
       
    def RemoveButtonFunc(self):
        char1 = self.comboBox_7.currentText()
        char2 = self.comboBox_8.currentText()
        
        self.enigma.remove_plug2(char1,char2)
        self.label_6.setText(self.enigma.get_plugboard())
        
    def StartButtonFunc(self):
        self.enigma.set_rotor('I',self.comboBox.currentText())
        self.enigma.set_rotor('II',self.comboBox_3.currentText())
        self.enigma.set_rotor('III',self.comboBox_5.currentText())

        self.enigma.set_rotor_position('I',self.comboBox_2.currentText())
        self.enigma.set_rotor_position('II',self.comboBox_4.currentText())
        self.enigma.set_rotor_position('III',self.comboBox_6.currentText())


        text = self.textEdit.toPlainText()
        self.label_7.setText(text)
        enc_text, enc_proc = self.enigma.encrypt_text2(text)
        
        self.comboBox_2.setCurrentIndex(self.alphabet.index(self.enigma.get_position('I')))
        self.comboBox_4.setCurrentIndex(self.alphabet.index(self.enigma.get_position('II')))
        self.comboBox_6.setCurrentIndex(self.alphabet.index(self.enigma.get_position('III')))
        
        self.label_4.setText(enc_text)
        self.label_5.setText(enc_proc)
        
        self.textEdit.clear()


